import React from "react";
import styled from 'styled-components';
const Wheel = () => {
    
    let Container = styled.div `
    //width:100%;
    max-width: 1200px;
    height: 100px;
    border: solid black 1px;
    `
    return (
        <Container></Container>
    )
}

export default Wheel;
